  \"2015-02-03T21:06:45.789763\",\n\t\"name\": \"habitat-offshore-of-tomales-point-california\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This part of DS 781 presents data for the
  habitat map of the seafloor of the Offshore of Tomales Point map area, California.
  The polygon shapefile is included in \"Habitat_OffshoreTomalesPoint.zip,\" which
  is accessible from http://pubs.usgs.gov/ds/781/OffshoreTomalesPoint/data_catalog_OffshoreTomalesPoint.html.
  Using multibeam echosounder (MBES) bathymetry and backscatter data, potential marine
  benthic habitat maps were constructed. The habitats were based on substrate types
  and documented or \"ground truthed\" using underwater video images and seafloor
  samples obtained by the USGS. These maps display various habitat types that range
  from flat, soft, unconsolidated sediment-covered seafloor to hard, deformed (folded),
  or highly rugose and differentially eroded bedrock exposures. Rugged, high-relief,
  rocky outcrops that have been eroded to form ledges and small caves are ideal habitat
  for rockfish (Sebastes spp.) and other bottom fish such as lingcod (Ophiodon elongatus).
  Habitat map is presented in a map format generated in a GIS (ArcMap), and both digital
  and hard-copy versions will be produced.\",\n\t\"license_title\": null,\n\t\"extras\":
